import React from 'react';

const ToDoList=(props)=>{
   

    return(
        <>
        <div className="todoStyle">
        <i class="far fa-times-circle" aria-hidden="true"
           onClick={()=>{
               props.onSelect(props.id)
           }}/>
        <li>{props.text}</li>
    </div>
    </>
    );
}
export default ToDoList;
